import React from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route
} from "react-router-dom";
import Data from './components/countriesData/data.js';
import CountryInfo from './components/countriesData/individualCountry.js';

export default function App() {
  return (
    <Router>
      <div>
        <nav>
          <ul>

          </ul>
        </nav>


        <Switch>
          <Route path="/">
            <Data />
          </Route>
          <Route path="/details">
            <CountryInfo/>
          </Route>
        </Switch>
      </div>
    </Router>
  );
}
